B.a52=new A.b2("It\u2019s time to relax. Time to let all the worry of today drift away. You are seated comfortably, and are about to consciously relax all of your muscles, one by one. Start with your hands. Let your fingers go limp\u2026 now your palms\u2026 now your wrists. Your forearms are completely relaxed now, and your elbows\u2026 your shoulders\u2026 and your back.\n\nRelax the muscles in your face. Your eyelids droop shut\u2026 the tension goes out of your neck. Your hips are loose and your thighs\u2026 your knees\u2026 your calves. Now your feet are going limp, every toe is relaxing. You are completely relaxed from head to toe. Breathe slowly and deeply from your diaphragm ten times, counting to five on each inhale, and five on each exhale.\n\nIn your mind, open your eyes. Ahead of you, there is a door, centered in the wall about ten steps away from you. You are going to walk towards that door, and with each step the worries and anxieties you are dealing with today will drift further and further away until all you see is the door.\n\nTake one slow step toward the door. One. Take another step. Two. Another. Three. As you near the door, it begins to glow softly. Four. It is a warm welcoming light. Five. The door is beginning to swing open. Six. Through the door is light. Seven. Through the door is warmth. Eight. Through the door is safety. Nine. You are about to step through the door. Ten.\n\nYou are standing, looking through the door at a baseball field. Step through the door, and shut it behind you. The sun is warm\u2026 The field is perfect\u2026 you can smell the fresh cut grass. Walk slowly to the field enjoying the gentle breeze and thinking how great it will be to play a game today and to be so relaxed and carefree.\n\nSee yourself at the plate. Feel your feet as you dig in the batters box and feel yourself grip the bat. Look up to see the pitcher on the mound getting ready to deliver a pitch. See the pitch travel to your perfect location. Feel the ball hit the sweet spot of the barrel as you drive the baseball and know that this pitcher cannot beat you. Feel the confidence you have knowing that you are in control of the situation and take in the feeling of playing the game with the same approach that you had when you were 8 years old. NO WORRIES\u2026 NO FEAR\u2026 JUST FUN\n\nIt\u2019s been a great game today. Now you see a door about ten steps away, coming into shape.\n\nTen. When you walk through the door you will be energized\nNine. When you walk through the door, you will be well rested\nEight. When you walk through the door, you will feel ready for today\nSeven. On the other side of that door is the world you left.\nSix. However, it has changed in your absence.\nFive. It is a calmer version of the world\nFour. There is nothing in the world that you cannot handle\nThree. You will have a great day today\nTwo. Are you ready?\nOne. Step through the door and open your eyes",null,B.a1U,null,null,null,null,null,null,null)
